class Node:
    def __init__(self, data = None):
        self.data = data
        self.left = None
        self.right = None

    ####################################################### dodatek do próby optymistycznych - skopiowane funkcje find i verify

    def find(self, data):
        self.root = Node(data)
        if self.root:
            is_found = self._find(data, self.root)                      #inicjalizator szukania
            if is_found:
                return is_found
            return False
        else:
            return None

    def _find(self, data, cur_node):
        if data > cur_node.data and cur_node.right:                     # właściwa funkcja szukająca
            return self._find(data, cur_node.right)

        elif data < cur_node.data and cur_node.left:
            return self._find(data, cur_node.left)

        if data == cur_node.data:
            return cur_node


    ####################################################### dodatek do próby optymistycznych - skopiowane funkcje find i verify

    # weryfikator
    def verify(self, data):
        self.root = Node(data)
        if self.root:
            self._verify(data, self.root)
            try:
                if self.tmp:
                    return self.tmp
                return False
            except AttributeError:
                return False
        else:
            return None
    def _verify(self, data, cur_node):
        if cur_node:
            self._verify(data, cur_node.left)
            self._verify(data, cur_node.right)

            if cur_node.data == data:
                print('verifier printout', cur_node.data)
                self.tmp = cur_node
                return self.tmp
            else:
                return False

class BST:
    def __init__(self):
        self.root = None

    def insert(self, data):
        if self.root is None:
            self.root = Node(data)
        else:
            self._insert(data, self.root)                       #jeśli coś już jest to wykonaj _insert
    def _insert(self, data, cur_node):
        if data < cur_node.data:
            if cur_node.left is None:
                cur_node.left = Node(data)                      #mniejsze na lewo, większe na prawo
            else:
                self._insert(data, cur_node.left)
        elif data > cur_node.data:
            if cur_node.right is None:
                cur_node.right = Node(data)
            else:
                self._insert(data, cur_node.right)
        else:
            print('Value is already in the tree')

    ####################################################### opracowywany algorytm

    def find(self, data):
        if self.root:
            is_found = self._find(data, self.root)                      #inicjalizator szukania
            if is_found:
                return is_found
            return False
        else:
            return None

    def _find(self, data, cur_node):
        if data > cur_node.data and cur_node.right:                     # właściwa funkcja szukająca
            return self._find(data, cur_node.right)

        elif data < cur_node.data and cur_node.left:
            return self._find(data, cur_node.left)

        if data == cur_node.data:
            return cur_node


    ####################################################### opracowywany algorytm

    # weryfikator
    def verify(self, data):
        if self.root:
            self._verify(data, self.root)
            try:
                if self.tmp:
                    return self.tmp
                return False
            except AttributeError:
                return False
        else:
            return None
    def _verify(self, data, cur_node):
        if cur_node:
            self._verify(data, cur_node.left)
            self._verify(data, cur_node.right)

            if cur_node.data == data:
                print('verifier printout', cur_node.data)
                self.tmp = cur_node
                return self.tmp
            else:
                return False
    ############ funkcje pomocnicze - wyświetlanie itp.
    def is_bst(self):
        if self.root:
            is_satisfied = self._is_bst(self.root, self.root.data)

            if is_satisfied is None:
                return True
            return False

        return True
    def _is_bst(self, cur_node, data):
        if cur_node.left:
            if data > cur_node.left.data:
                return self._is_bst(cur_node.left, cur_node.left.data)
            else:
                return False
        if cur_node.right:
            if data < cur_node.right.data:
                return self._is_bst(cur_node.right, cur_node.right.data)
            else:
                return False

    def inorder_print(self):
        if self.root:
            self._inorder_print(self.root)
    def _inorder_print(self, cur_node):
        if cur_node:
            self._inorder_print(cur_node.left)
            print(str(cur_node.data))
            self._inorder_print(cur_node.right)


